#БНИ_куплюБУ_Москва
#БНИ_AS_Savelev

Куплю коробки из под игр и промо карту:

1) 2-е коробки размера 279x196x63 мм
Например следующие игры:
- Древний Ужас: Знамения Каркозы;
- Древний Ужас: Таинственные Руины;
- Древний Ужас: Забытые Тайны;
- Амул;
- За шотландию;
- прочие, аналогичного размера. 

Примечание: коробки не должны быть порваными или помятыми, но могут быть сильно потертыми (не до дыр) 

2) 1-а от базы или 2 от дополнения. 
Коробки из под игры "Особняки безумия"
Любая из:
- Особняки безумия (2nd edition);
- Особняки безумия: Улицы Аркхэма;
- Особняки безумия. Вторая редакция: Зловещие путешествия;
- Особняки безумия. Вторая редакция: Путь змеи. 

Примечание: интересует идеальное состояние коробки, предпочтительно базовая коробка. 

3) Интересует промокарта к игре "Славика"
